        // FunciÃ³n Helper para leer la imagen que YA existe en storage
        $processImage = function ($filename) {
            // Asumimos que la imagen ya estÃ¡ en 'storage/app/public/products/'
            // Si la tienes suelta en 'public/', ajusta la ruta.
            
            // Ruta relativa dentro del disco 'public'
            $storageName = 'products/' . $filename; 
            
            // Ruta completa en el sistema para leer el binario
            $fullPath = storage_path('app/public/' . $storageName);

            if (File::exists($fullPath)) {
                // Leemos el archivo para crear el BLOB
                $type = pathinfo($fullPath, PATHINFO_EXTENSION);
                $data = file_get_contents($fullPath);
                $base64 = 'data:image/' . $type . ';base64,' . base64_encode($data);

                return [
                    'path' => $storageName, // Ruta para la web
                    'blob' => $base64       // Dato binario para la BBDD
                ];
            } else {
                // Si no encuentra la foto, avisa pero no rompe la web
                echo "âš ï¸ CUIDADO: No encuentro la foto en: $fullPath \n";
                return ['path' => null, 'blob' => null];
            }
        };

